import React from 'react'
import '../styles'
import reactsvg from './assets/images/react.svg'

function Footer () {
  return (
    <footer class='footer'>
      <div class='bottom'>Clicky Game! <img alt='react' src={reactsvg} />
      </div>
    </footer>
  )
}

export default Footer
